let path = configuration['oauth.authorization.url'];
let cId = request_parameters['client_id'];

//If provisioning with sandbox
if(configuration['clover.sandbox'] === 'true') {
	path = path.replace('https://clover.com/oauth/authorize', 'https://sandbox.dev.clover.com/oauth/authorize');
	if (cId.indexOf('|') > -1) {
		cId = cId.substring(cId.indexOf('|')+1, cId.length);	
	}
} else {
	//If provisioning with Live account
	if (cId.indexOf('|') > -1) {
		cId = cId.substring(0, cId.indexOf('|'));
	}
}


path += "?client_id=" + cId + "&merchant_id=" + configuration['merchantId'];
done({
	"request_vendor_path": path
});

let path = configuration['oauth.token.url'];
let key = request_parameters['client_id'];
let secret = request_parameters['client_secret'];

//If provisioning with sandbox
if(configuration['clover.sandbox'] === 'true') {
	path = path.replace('https://clover.com/oauth/token', 'https://sandbox.dev.clover.com/oauth/token');
	if (key && key.indexOf('|') > -1) {
		key = key.substring(key.indexOf('|')+1, key.length);
	}
	if (secret && secret.indexOf('|') > -1) {
		secret = secret.substring(secret.indexOf('|')+1, secret.length);
	}
} else {
	//If provisioning with Live account
	if (key && key.indexOf('|') > -1) {
		key = key.substring(0, key.indexOf('|'));
	}
	if (secret && secret.indexOf('|') > -1) {
		secret = secret.substring(0, secret.indexOf('|'))
	}
}

path += "?client_id=" + key + "&client_secret=" + secret;
done({
	"request_vendor_path": path
});

